import React from 'react'

import {connect} from 'react-redux'
import {selectCollectionByQuery} from '../../redux/shop/shop.selectors'

import CollectionContainer from '../../components/collection-container/collection-container.component'

const SearchResultsPage = ({ collection }) => {
    const {title, items} = collection

    return (
        <CollectionContainer items = {items} title = {title} />
)}

const mapStateToProps = (state, ownProps) => ({
    collection: selectCollectionByQuery('Men')(state),
})

export default connect(mapStateToProps)(SearchResultsPage)
